import React, { Component} from "react";
import "./tasks-filter.css";

class TasksFilter extends Component{


    render() {
        const {butEl, allTodo} = this.props
        return (
            <li key={butEl.id }>
                <button onClick={allTodo} className={butEl.className}>{butEl.text}</button>
            </li>
        );
    }
}

export default TasksFilter;
